const Forcast = (props) => {
    const {daily,hourly} = props;

    return (
        <div>
            <div>
                <a className="active">Hourly</a>
                <a>Daily</a>
            </div>
            <div>
                <DailyForcast daily={daily}/>
            </div>

        </div>
    );
};
